import React, { useEffect } from "react";

export default function Offert() {
  useEffect(() => {
    const show = document.getElementById("aboutme");
    show.classList.remove("transform");
  }, []);
  return (
    <div className="ContainerSection transform" id="aboutme">
      <div className="OfferGridContainer">
        <div className="DescriptionOffer">
          <div className="DescriptionOffer__wedding"></div>
          <div className="DescriptionOffer__business"></div>
          <div className="DescriptionOffer__100"></div>
          <div className="DescriptionOffer__other"></div>
        </div>
        <div className="OfferBoxes">
          <figure className="OfferBoxes__wedding">
            <figcaption>Wesele</figcaption>
          </figure>
          <figure className="OfferBoxes__business">
            <figcaption>Impreza Firmowe</figcaption>
          </figure>
          <figure className="OfferBoxes__100">
            <figcaption>100dniówka</figcaption>
          </figure>
          <figure className="OfferBoxes__other">
            <figcaption>Obsługa innych imprez</figcaption>
          </figure>
        </div>
      </div>
    </div>
  );
}
